column13:
Le domaine général de l'invention est celui des procédés de réalisation d'une optique de couplage (3) pour système de captation d'images à bas niveau de lumière. Le système de captation d'images comprend un intensificateur de lumière (2), l'optique de couplage et un capteur photosensible matriciel (4). Le procédé de réalisation de l'optique de couplage selon l'invention comporte les étapes suivantes : 
Etape 1 : Calcul du grandissement optimal de l'optique de couplage ; 
Etape 2 : Calcul du nombre d'ouverture de l'optique de couplage de façon que le diamètre de la tache de diffraction, image d'un objet ponctuel donnée par l'optique de couplage sur ledit écran phosphorescent soit inférieur ou de l'ordre de grandeur des dimensions des pixels du capteur photosensible ; 
Etape 3 : Calcul du gain d'amplification de l'intensificateur de façon que, pour un minimum de luminance de l'image captée, le flux lumineux reçu par chaque pixel élémentaire soit égal ou supérieur au flux minimal donné par la sensibilité du capteur photosensible.

5 n7 A catheter (12) for use with a guidewire (14), the catheter being guidable from an external body access site to and into an internal tissue, the catheter comprising:
 an elongate tubular member having proximal and distal ends and an inner lumen (13) extending between the proximal and distal ends, said member being composed of: a relatively stiff proximal segment (16) for tracking the wire from the access site to a region adjacent the internal tissue; and a relatively flexible distal segment (18) for tracking the wire within the internal tissue; 
characterised in that the proximal segment (16) has a distal portion and a proximal portion, that the tubular member comprises a relatively stiff tube (20) and a relatively flexible tube (22), one end of one of these tubes being coaxially overlapped with one end of the other of the tubes such that the overlap forms the distal portion only of the proximal segment (16), with the distal segment (18) being a distal extension of the relatively flexible tube (22), and that the distal segment is guidable into the internal tissue along a tortuous path within the internal tissue of at least about 5cm through vessels of less than about 3mm lumen inner diameter.

This invention relates to a cleaning composition for hard surfaces, comprising at least one surfactant and a water-soluble or water-dispersible copolymer comprising, in the form of polymerized units: 

(a) at least one monomeric compound of general formula I; 

(b) at least one hydrophilic monomer chosen from C _{ 3 } -C _{ 8 } carboxylic acids containing monoethylenic unsaturation, anhydrides thereof and water-soluble salts thereof; 

(c) optionally, at least one hydrophilic monomeric compound containing ethylenic unsaturation, of neutral charge, bearing one or more hydrophilic groups, which is copolymerizable with (a) and (b).
